import React from 'react';
import './App.css';

interface User {
  user_id: number,
  username: string,
  email: string,
  sold: number,
}

async function getUsers(): Promise<User[]> {
  const response = await fetch("http://localhost:8080");
  const data = await response.json();

  return data;
}

async function App() {
  const users: User[] = await getUsers();
  return (
    <div className="App">
      <ul>
        {users.map((user) => {return <li>{user.username}</li>})}
      </ul>
    </div>
  );
}

export default App;
